import { map } from "fp-ts/lib/Array"
import { flow } from "fp-ts/lib/function"
import { produce } from "immer"
import React, { useCallback } from "react"
import { DropResult } from "react-beautiful-dnd"

import { Program } from "../../../domain/program"
import { Table } from "../../layouts/ColumnDragDrop/Table"

import { Exercise } from "./Exercise"
import styles from "./Program.scss"

type Reducer<A> = (a: A) => A

const moveColumn = (result: DropResult): Reducer<Program> =>
  produce((state: Program) => {
    if (!result.destination) return

    const [column] = state.splice(result.source.index, 1)
    state.splice(result.destination?.index, 0, column)
  })

const moveCell = (result: DropResult): Reducer<Program> =>
  produce((state: Program) => {
    if (!result.destination) return

    const [item] =
      state[parseInt(result.source.droppableId, 10)].exercises.splice(result.source.index, 1) ?? []

    state[parseInt(result.destination.droppableId, 10)].exercises.splice(
      result.destination.index ?? 0,
      0,
      item,
    )
  })

const stateReducer = (result: DropResult): Reducer<Program> =>
  result.type === "column" ? moveColumn(result) : moveCell(result)

interface Props {
  program: Program
  updateProgram: (reducer: (program: Program) => Program) => void
}

const toTableContents: (program: Program) => JSX.Element[][] = flow(
  map(workout => workout.exercises),
  map(map(exercise => <Exercise {...exercise} />)),
)

const toHeaders: (program: Program) => JSX.Element[] = map(workout => (
  <div className={styles.title}>{workout.name}</div>
))

export const ProgramBuilder: React.FC<Props> = ({ program, updateProgram }) => {
  const onDragEnd = useCallback(flow(stateReducer, updateProgram), [updateProgram])

  return (
    <div className={styles.container}>
      <h1>Program</h1>
      <Table
        headers={toHeaders(program)}
        tableContents={toTableContents(program)}
        onDragEnd={onDragEnd}
      />
    </div>
  )
}

import React from "react"
import { DragDropContext, Droppable, DropResult } from "react-beautiful-dnd"

import { Column } from "./Column"
import styles from "./Table.scss"

interface Props {
  headers: JSX.Element[]
  tableContents: JSX.Element[][]
  onDragEnd: (drag: DropResult) => void
}

export const Table = ({ headers, tableContents, onDragEnd }: Props): JSX.Element => (
  <DragDropContext onDragEnd={onDragEnd}>
    <div className={styles.container}>
      <div className={styles.background}>
        {tableContents.map((_, index) => (
          <div key={index} className={styles.column} />
        ))}
      </div>
      <Droppable droppableId="table" type="column" direction="horizontal">
        {({ innerRef, droppableProps, placeholder }) => (
          <div className={styles.foreground} ref={innerRef} {...droppableProps}>
            {tableContents.map((columnContents, columnIndex) => (
              <Column
                key={columnIndex}
                index={columnIndex}
                header={headers[columnIndex]}
                contents={columnContents}
              />
            ))}
            {placeholder}
          </div>
        )}
      </Droppable>
    </div>
  </DragDropContext>
)

import React from "react"
import { Droppable, Draggable } from "react-beautiful-dnd"

import { Cell } from "./Cell"
import styles from "./Table.scss"

interface Props {
  index: number
  header?: JSX.Element
  contents: JSX.Element[]
}

export const Column: React.FC<Props> = ({ index, header, contents }) => (
  <Draggable index={index} draggableId={String(index)}>
    {({ innerRef: dragInnerRef, dragHandleProps, draggableProps }) => (
      <Droppable droppableId={String(index)} type="cell" direction="vertical">
        {({ droppableProps, innerRef: dropInnerRef, placeholder }) => (
          <div
            className={styles.column}
            ref={ref => (dragInnerRef(ref), dropInnerRef(ref))}
            {...draggableProps}
            {...dragHandleProps}
            {...droppableProps}
          >
            {header}
            {contents.map((cellContents, cellIndex) => (
              <Cell key={cellIndex} index={cellIndex} contents={cellContents} />
            ))}
            {placeholder}
          </div>
        )}
      </Droppable>
    )}
  </Draggable>
)

import React from "react"
import { Draggable } from "react-beautiful-dnd"

import { useId } from "../../../lib/useId"

import styles from "./Table.scss"

interface Props {
  index: number
  contents: JSX.Element
}

export const Cell: React.FC<Props> = ({ index, contents }) => (
  <Draggable index={index} draggableId={useId()}>
    {({ innerRef, draggableProps, dragHandleProps }) => (
      <div className={styles.cell} ref={innerRef} {...draggableProps} {...dragHandleProps}>
        {contents}
      </div>
    )}
  </Draggable>
)

import { useState } from "react"
import uuid = require("uuid")

export const useId = (): string => useState(uuid())[0]
